import React, { useEffect, useState } from "react";
import axios from "axios";

const App = () => {
  const [data, setData] = useState([]);

  const getData = async () => {
    const res = await axios("https://api.coingecko.com/api/v3/coins/list");
    setData(await res.data);
  };
  useEffect(() => {getData()}, []);

  return (
      <div>
      <h2>Coins</h2>
      <p></p>
      </div>
  )
};

export default App;
